import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './index.css';

import Pc from './pc';
import Schoolwisepc from './schoolwisepc';

function Home() {
  const navigate = useNavigate();
  const [view, setView] = useState('pc');  // Default view is 'pc'

  const handleLogout = () => {
    navigate('/login'); // Redirect to login page after logout
  };

  const handlePCClick = () => {
    setView('pc'); // Change view to "PC"
  };

  const handleVideoClick = () => {
    setView('video'); // Change view to "Video"
  };

  return (
    <div className="d-flex">
      <div className="sidebar bg-light">
        <div className="sidebar-header p-">
          <h5>Navigation</h5>
        </div>
        <div className="list-group">
          <button className="list-group-item list-group-item-action" onClick={handlePCClick}>PC</button>
          <button className="list-group-item list-group-item-action" onClick={handleVideoClick}>Video</button>
        </div>
      </div>
      <div className="main-content flex-grow-1">
        <nav className="navbar navbar-expand-lg navbar-light bg-success">
          <div className="container-fluid">
            <Link className="navbar-brand text-white" to="/home">DLAB ADMIN PANEL</Link>
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
              <ul className="navbar-nav ms-auto">
                <li className="nav-item">
                  <button className="btn btn-link nav-link text-white" onClick={handleLogout}>Logout</button>
                </li>
              </ul>
            </div>
          </div>
        </nav>
        <div className="container mt-3">
          {view === 'pc' ? (
            <div className="" role="alert">
               <Pc/>
               <Schoolwisepc/>
            </div>
          ) : (
            <div className="" role="alert">
              What's up
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default Home;
